import routes from './routes'
import express from 'express'
import path from 'path'
import pug from 'pug'
import https from 'https'
import bodyParser from 'body-parser'
import compression from 'compression'
import fs from 'fs'
import AmazonCognitoIdentity from 'amazon-cognito-identity-js'

import AWS from 'aws-sdk'
import cors from 'cors'

const app = express()

const USER_POOL_ID = "us-east-1_qoH4INlPH"
const IDENTITY_POOL_ID = 'us-east-1:5c26eb1e-b59b-428a-9545-f4b6dbc2fd1d'
const REGION = 'us-east-1'
const CLIENT_ID = '5p03iappprdnsrku6iujah37er'
const ROLE_ARN = "arn:aws:iam::827048324079:role/CognitoQuickSightIdentityPoolAuthRole"
const API_VERSION_COGNITO_CLIENT = "2016-04-19"
const DASHBOARD_ID = "75486ef4-956c-4f24-8e08-ff027b17f410"
const AWS_ACCOUNT_ID = "827048324079"

const API_CONFIG = './quicksight-2018-04-01.min.json'
const SSL_KEY = './server/key.pem'
const SSL_CERT = './server/certificate.pem'
const SSL_C= './server/certificate.p12'

const { signIn, removeUser, signUp, setPassword, quicksightEmbedURL, quicksightRegisterUser } = require('./quicksight')

const COGNITO_CLIENT = new AWS.CognitoIdentityServiceProvider({
    apiVersion: API_VERSION_COGNITO_CLIENT,
    region: REGION
})

const COGNITO_USERPOOL_ID = { COGNITO_CLIENT, USER_POOL_ID }

app.use(bodyParser.json())
app.use(cors())

app.get('/data', (req, res) => {
    const quicksight = new AWS.Service({
        apiConfig: require(API_CONFIG),
        region: REGION
    })
    quicksightEmbedURL({AWS_ACCOUNT_ID, DASHBOARD_ID}, quicksight, res)
})

app.post('/setpw', (req, res) => {
    setPassword(req.body.email, req.body.password, {COGNITO_CLIENT, USER_POOL_ID})
    res.send('set pw')
})

app.post('/remove', (req, res) => {
    console.log("body", req.body.email)
    removeUser(req.body.email, {COGNITO_CLIENT, USER_POOL_ID})
    res.send('removed')
})

app.post('/quickiSightEmbedUrl', (req, res) => {
    console.log("req body >>>>>>>>>>>" ,req.body)
    quicksightRegisterUser({AWS, REGION, AWS_ACCOUNT_ID, DASHBOARD_ID, ROLE_ARN  }, req.body.data ,req.body.email,res)

})

app.post('/signup', async (req, res) => {

    const result = await signUp(req.body.email, "Abc@3216T", {COGNITO_CLIENT, USER_POOL_ID})
    console.log('result', result)
    res.send('signup')
})

app.engine('pug', pug.__express)
app.set('views', path.join(__dirname, '..', 'views'))
app.set('view engine', 'pug')
app.use(compression())
app.use(express.static('./public'))
app.get('*.js', function (req, res, next) {
  req.url = req.url + '.gz';
  res.set('Content-Encoding', 'gzip');
  next()
})
app.use('/', routes)

https.createServer({
    key: fs.readFileSync(SSL_KEY),
    cert: fs.readFileSync(SSL_CERT),
    ca: fs.readFileSync(SSL_C)
}, app).listen(443)

