sourcesContent:
'use strict'
import axios from 'axios'
import ls from 'local-storage'

const quicksightList = (quicksight,  MaxResults = 100, NextToken = 0) => {
    quicksight.listUsers(params, function(err, data) {
        if (err) console.log(err, err.stack); // an error occurred
        else     console.log(data);           // successful response
    })
}

const setCognitoIdentity = (email, password, {USER_POOL_ID, CLIENT_ID},AmazonCognitoIdentity) => {
        return new Promise( async (resolve, reject) => {
            try {
                const authenticationData = {
                    Username: email,
                    Password: password,
                }
                const authenticationDetails = await new AmazonCognitoIdentity.AuthenticationDetails(authenticationData)
                const poolData = {
                    UserPoolId: USER_POOL_ID,
                    ClientId: CLIENT_ID,
                    Storage: new AmazonCognitoIdentity.CookieStorage({domain: "quicksight.moreforme.net"})
                }
                const userPool = new AmazonCognitoIdentity.CognitoUserPool(poolData);
                const userData = {
                    Username: email,
                    Pool: userPool,
                    Storage: new AmazonCognitoIdentity.CookieStorage({domain: "quicksight.moreforme.net"})
                }
                const cognitoUser = new AmazonCognitoIdentity.CognitoUser(userData)
                resolve({authenticationDetails, cognitoUser})
            } catch (err) {
                console.log("setCognitoIdentity Error: >>>>>>>>>>>>", err.message, err)
                reject(false)
            }
        })
}



const quicksightRegisterUser = ({AWS, REGION, AWS_ACCOUNT_ID, DASHBOARD_ID, ROLE_ARN  }, email) => {
    const quicksight = new AWS.Service({
        apiConfig: require('./quicksight-2018-04-01.min.json'),
        region: REGION
    })
    quicksight.registerUser({
        AwsAccountId: AWS_ACCOUNT_ID,
        Email: email,
        IdentityType: 'IAM' ,
        Namespace: 'default',
        UserRole: 'READER',
        SessionName: email,
        IamArn: ROLE_ARN
    }, (err) => {
        if(err) {
            console.log("quicksightRegisterUser Error >>>>>>>>>>>>", err.message)
        }
        quicksightEmbedURL({AWS_ACCOUNT_ID, DASHBOARD_ID}, quicksight)
    })
}

const quicksightEmbedURL = ({AWS_ACCOUNT_ID, DASHBOARD_ID}, quicksight) => {
    quicksight.getDashboardEmbedUrl({
        AwsAccountId: AWS_ACCOUNT_ID,
        DashboardId: DASHBOARD_ID,
        IdentityType: 'IAM',
        ResetDisabled: true,
        SessionLifetimeInMinutes: 120,
        UndoRedoDisabled: false
    }, (err, data) => {
        if(err) {
            console.log('quicksightEmbedURL Errors: >>>>>>>>>>>>', err.message)
        }
        let Qurl = ''
        if(data && data.EmbedUrl) {
            Qurl = data.EmbedUrl
        }
        console.log("Qurl ::",Qurl)
    })
}

const signIn = async (email, password, options, AmazonCognitoIdentity) => {
  try {
    return new Promise( async (resolve, reject) => {
        const {
          AWS, REGION, IDENTITY_POOL_ID, CLIENT_ID, ROLE_ARN, AWS_ACCOUNT_ID, USER_POOL_ID, DASHBOARD_ID
        } = options
        const {
          authenticationDetails, cognitoUser
        } = await setCognitoIdentity(email, password, {USER_POOL_ID, CLIENT_ID}, AmazonCognitoIdentity)
        cognitoUser.authenticateUser(authenticationDetails, {
          onSuccess: async (result) => {
            AWS.config.region = REGION
            AWS.config.credentials = new AWS.CognitoIdentityCredentials({
              IdentityPoolId: IDENTITY_POOL_ID,
              Logins: {
                'cognito-idp.us-east-1.amazonaws.com/us-east-1_qoH4INlPH': result.getIdToken().getJwtToken()
              }
            })
            console.log("token", result.getIdToken().getJwtToken())
            const resp = await stsAssumeRole(result.getIdToken().getJwtToken(), email, {ROLE_ARN, AWS_ACCOUNT_ID, AWS, REGION, DASHBOARD_ID})
            if(resp.data && resp.data.EmbedUrl) {
                ls.set('qurl', resp.data.EmbedUrl)
                return resolve(resp.data.EmbedUrl)
            }
            return resolve(false)
          },
          onFailure: (err) => {
            console.log("onFailureError:: ",err)
          }
        })

    })
  } catch (e) {

    console.log("error", e)
    return resolve(false)
  }
}

const tempSignIn = async (email, oldpw, password, options, AmazonCognitoIdentity) => {
  try {
    console.log("cred", email, oldpw, password)
    return new Promise( async (resolve, reject) => {
      const {
        AWS, REGION, IDENTITY_POOL_ID, CLIENT_ID, USER_POOL_ID
      } = options
      const {
        authenticationDetails, cognitoUser
      } = await setCognitoIdentity(email, oldpw, {USER_POOL_ID, CLIENT_ID}, AmazonCognitoIdentity)

      cognitoUser.authenticateUser(authenticationDetails, {
        onSuccess: async (result) => {
          AWS.config.region = REGION
          AWS.config.credentials = new AWS.CognitoIdentityCredentials({
            IdentityPoolId: IDENTITY_POOL_ID,
            Logins: {
              'cognito-idp.us-east-1.amazonaws.com/us-east-1_qoH4INlPH': result.getIdToken().getJwtToken()
            }
          })
          resolve(true)
        },
        onFailure: (err) => {
          console.log("onFailureError >>>>>>>>>>>>", err)
          return resolve(false)
        },
        newPasswordRequired: function (userAttributes) {
          delete userAttributes.email_verified;
          cognitoUser.completeNewPasswordChallenge(password, userAttributes, this);
          resolve(true)
        }
      })

    })
  } catch (e) {
    console.log("error", e)
  }
}

