import React, { Component } from 'react'
import ReactDOM from 'react-dom'
import { Link, Redirect } from 'react-router-dom'
import { connect } from 'react-redux'
import { makeStyles } from '@material-ui/core/styles'
import TextField from '@material-ui/core/TextField'
import { FormControl, Container, Button, Typography } from '@material-ui/core'
import { signInTempQuicksight } from '../utils/quicksight'

const AmazonCognitoIdentity = require('amazon-cognito-identity-js')
const AWS = require('aws-sdk')
const USER_POOL_ID = "us-east-1_qoH4INlPH"
const IDENTITY_POOL_ID = 'us-east-1:5c26eb1e-b59b-428a-9545-f4b6dbc2fd1d'
const REGION = 'us-east-1'
const CLIENT_ID = '5p03iappprdnsrku6iujah37er'
const ROLE_ARN = "arn:aws:iam::827048324079:role/CognitoQuickSightIdentityPoolAuthRole"
const DASHBOARD_ID = "75486ef4-956c-4f24-8e08-ff027b17f410"
const AWS_ACCOUNT_ID = "827048324079"

class ChangePassword extends Component {
    constructor(props) {
      super(props);
      this.state = {
        qrl: '',
        email: 'gearsoflife.mark@gmail.com',
        oldPassword: 'Abc@3216T',
        password: 'aNxc1433z@uIAgx0b',
        isloading: false,
        success: false
      }
      this.handleChange = this.handleChange.bind(this)
      this.handleSubmit = this.handleSubmit.bind(this)
      this.changePW = this.changePW.bind(this)
    }

    async changePW(email, tempPassword, password) {
      this.setState({ isloading: true })
      const options = {
        AWS, REGION, IDENTITY_POOL_ID, CLIENT_ID, ROLE_ARN, AWS_ACCOUNT_ID, USER_POOL_ID, DASHBOARD_ID
      }

      const result = await signInTempQuicksight(email,tempPassword, password, options, AmazonCognitoIdentity)
      console.log("result", result)
      if(result) {
        this.setState({ success: true })
      }

    }

    handleSubmit(event) {
      event.preventDefault()
      this.changePW(this.state.email, this.state.oldPassword, this.state.password)
    }

    handleChange(event) {
      const target = event.target;
      const value = target.type === 'checkbox' ? target.checked : target.value;
      const name = target.name;
      this.setState({
        [name]: value
      });
    }

  render() {
    return (
        <Container maxWidth='sm'  style={{padding:'5px'}}>
        <Typography variant="h4" style={{marginTop:'15px'}} component="h4">
          CHANGE PASSWORD
        </Typography>

          { this.state.success &&
              <Redirect
                to={{
                  pathname: "/login",
                  state: { }
                }}
              />
          }

          {
            this.state.isloading &&
            <h3 style={{color:'#828282'}}> > Please wait.._ </h3>
          }

          {
            this.state.error &&
            <h3 style={{color:'#dc143c'}}> >ERROR PLEASE TRY AGAIN_ </h3>
          }

          <form onSubmit={this.handleSubmit} noValidate autoComplete="off">
             <FormControl fullWidth='true' margin='normal'>
              <TextField id="email" label="Email" name="email" variant="filled" onChange={this.handleChange} value={this.state.email} />
             </FormControl>
             <FormControl fullWidth='true' margin='normal'>
              <TextField id="oldPassword" label="Old Password" name="oldPassword" type="password" variant="filled" onChange={this.handleChange} value={this.state.oldPassword} />
             </FormControl>
             <FormControl fullWidth='true' margin='normal'>
              <TextField id="password" label="New Password" name="password" type="password" variant="filled" onChange={this.handleChange} value={this.state.password} />
             </FormControl>
             <Button style={{marginTop:'15px', padding: '10px 20px'}} type="submit" variant="contained" color="secondary">
              Submit
            </Button>
          </form>
        </Container >
    )
  }
}

function mapStateToProps(state, props) {
  return {
    state
  }
}

function mapDispatchToProps(dispatch) {
  return {

  }
}

export default connect(mapStateToProps, mapDispatchToProps)(ChangePassword)

