import React, { Component } from 'react'
import ReactDOM from 'react-dom'
import { Link, Redirect } from 'react-router-dom'
import { connect } from 'react-redux'
import { makeStyles } from '@material-ui/core/styles'
import TextField from '@material-ui/core/TextField'
import { FormControl, Container, Button, Typography } from '@material-ui/core'
import Iframe from 'react-iframe'
import ls from 'local-storage'

class QsAnalytics extends Component {
    constructor(props) {
      super(props);
      this.state = {
        qrl: '',
      }
    }

    async componentDidMount(prevProps, prevState) {
      const qurl = await ls.get('qurl')
      console.log("anal", qurl)
      this.setState({ qrl: qurl })
    }

  render() {
    return (
        <Container maxWidth={false}  style={{padding:'5px', height:'900px'}}>
        <Typography variant="h4" align="center" style={{marginTop:'15px'}} component="h4">
          ANALYTICS
        </Typography>
          <Iframe url={this.state.qrl}
              width="100% "
              height="100%"
              id="myId"
              className="myClassname"
              display="initial"
              border="none"
              position="relative"
              frameBorder="0"/>
        </Container >
    )
  }
}

function mapStateToProps(state, props) {
  return {
    state
  }
}

function mapDispatchToProps(dispatch) {
  return {

  }
}

export default connect(mapStateToProps, mapDispatchToProps)(QsAnalytics)

