'use strict'

const quicksightList = (quicksight,  MaxResults = 100, NextToken = 0) => {
    quicksight.listUsers(params, function(err, data) {
        if (err) console.log(err, err.stack); // an error occurred
        else     console.log(data);           // successful response
    })
}

const setCognitoIdentity = (email, password, {USER_POOL_ID, CLIENT_ID},AmazonCognitoIdentity) => {
        return new Promise( async (resolve, reject) => {
            try {
                const authenticationData = {
                    Username: email,
                    Password: password,
                }
                const authenticationDetails = await new AmazonCognitoIdentity.AuthenticationDetails(authenticationData)
                const poolData = {
                    UserPoolId: USER_POOL_ID,
                    ClientId: CLIENT_ID,
                    Storage: new AmazonCognitoIdentity.CookieStorage({domain: "quicksight.moreforme.net"})
                }
                const userPool = new AmazonCognitoIdentity.CognitoUserPool(poolData);
                const userData = {
                    Username: email,
                    Pool: userPool,
                    Storage: new AmazonCognitoIdentity.CookieStorage({domain: "quicksight.moreforme.net"})
                }
                const cognitoUser = new AmazonCognitoIdentity.CognitoUser(userData)
                resolve({authenticationDetails, cognitoUser})
            } catch (err) {
                console.log("setCognitoIdentity Error: >>>>>>>>>>>>", err.message)
                reject(false)
            }
        })
}

const stsAssumeRole = (email, { ROLE_ARN, AWS_ACCOUNT_ID, AWS, REGION, DASHBOARD_ID }, res) => {
    const sts = new AWS.STS({apiVersion: "2012-10-17"})
    sts.assumeRole({
        RoleArn: ROLE_ARN,
        RoleSessionName: email
    }, async (err, data) => {
        if (err){
            console.log( "sts err: ",err)
        } else {
            console.log("sts: ",data)
            AWS.config.update({
                accessKeyId: data.Credentials.AccessKeyId,
                secretAccessKey: data.Credentials.SecretAccessKey,
                sessionToken: data.Credentials.SessionToken,
                region: REGION
            })
            quicksightRegisterUser({AWS, REGION, AWS_ACCOUNT_ID, DASHBOARD_ID, ROLE_ARN}, email, res)
        }
    })
}

const quicksightRegisterUser = ({AWS, REGION, AWS_ACCOUNT_ID, DASHBOARD_ID, ROLE_ARN  }, data ,email, res) => {

    AWS.config.update({
        accessKeyId: data.Credentials.AccessKeyId,
        secretAccessKey: data.Credentials.SecretAccessKey,
        sessionToken: data.Credentials.SessionToken,
        region: REGION
    })

    const quicksight = new AWS.Service({
        apiConfig: require('./quicksight-2018-04-01.min.json'),
        region: REGION
    })
    quicksight.registerUser({
        AwsAccountId: AWS_ACCOUNT_ID,
        Email: email,
        IdentityType: 'IAM' ,
        Namespace: 'default',
        UserRole: 'READER',
        SessionName: email,
        IamArn: ROLE_ARN
    }, (err) => {
        if(err) {
            console.log("quicksightRegisterUser Error >>>>>>>>>>>>", err.message)
        }
        quicksightEmbedURL({AWS_ACCOUNT_ID, DASHBOARD_ID}, quicksight, res)
    })
}

const quicksightEmbedURL = ({AWS_ACCOUNT_ID, DASHBOARD_ID}, quicksight, res) => {
    quicksight.getDashboardEmbedUrl({
        AwsAccountId: AWS_ACCOUNT_ID,
        DashboardId: DASHBOARD_ID,
        IdentityType: 'IAM',
        ResetDisabled: true,
        SessionLifetimeInMinutes: 120,
        UndoRedoDisabled: false
    }, (err, data) => {
        if(err) {
            console.log('quicksightEmbedURL Errors: >>>>>>>>>>>>', err.message)
            //return resolve(false)
        }
        let Qurl = ''
        if(data && data.EmbedUrl) {
            Qurl = data.EmbedUrl
        }
        console.log("QURL:: ",Qurl)
        res.json({ Qurl })
    })
}

const removeUser = (email, {COGNITO_CLIENT, USER_POOL_ID}) => {
    COGNITO_CLIENT.adminDeleteUser({
        UserPoolId: USER_POOL_ID,
        Username: email
    }, (err, data) => {
        if (err) console.log(err, err.stack)
        else    console.log(data);
    })
}

const setPassword = (email, password, {COGNITO_CLIENT, USER_POOL_ID}) => {
    COGNITO_CLIENT.adminSetUserPassword({
        password,
        UserPoolId: USER_POOL_ID,
        Username: email,
        Permanent: true
    }, function(err, data) {
        if (err) console.log(err, err.stack);
        else     console.log(data);
    })
}

const changePassword = (oldpw, newpw, accessToken, COGNITO_CLIENT) => {
    COGNITO_CLIENT.changePassword({
        AccessToken: accessToken,
        PreviousPassword: oldpw,
        ProposedPassword: newpw
    }, (err, data) => {
        if (err) console.log(err, err.stack);
        else     console.log(data);
    })
}

const signUp = (email, tempPW, {USER_POOL_ID, COGNITO_CLIENT}) => {
    return new Promise( async (resolve, reject) => {
        COGNITO_CLIENT.adminCreateUser({
            UserPoolId: USER_POOL_ID,
            Username: email,
            DesiredDeliveryMediums: ["EMAIL"],
            TemporaryPassword: tempPW,
            UserAttributes: [
                {
                    Name: "email",
                    Value: email
                },
                {
                    Name: "email_verified",
                    Value: "true"
                }
            ]
        }, (err, data) => {
            if(err) {
                console.log("signUp error",err)
                return reject(err)
            }
            return resolve(data)
        })
    })
}

module.exports =  {
    removeUser,
    setPassword,
    changePassword,
    signUp,
    quicksightEmbedURL,
    quicksightRegisterUser
}

